DROP TABLE IF EXISTS `unidades`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `unidades` (
  `id_unidade` int NOT NULL,
  `codigo` int DEFAULT NULL,
  `nome_unidade` varchar(120) DEFAULT NULL,
  `sigla` varchar(45) DEFAULT NULL,
  `email` varchar(45) DEFAULT NULL,
  `municipio` varchar(100) DEFAULT NULL,
  `id_unidade_gestora` int DEFAULT NULL,
  `unidade_gestora` varchar(100) DEFAULT NULL,
  `id_unidade_responsavel` int DEFAULT NULL,
  `unidade_responsavel` varchar(100) DEFAULT NULL,
  `data_criacao` date DEFAULT NULL,
  `data_extincao` varchar(45) DEFAULT NULL,
  `classificacao_unidade` varchar(100) DEFAULT NULL,
  `nivel_organizacional` varchar(100) DEFAULT NULL,
  `ambiente_organizacional_unidade` varchar(100) DEFAULT NULL,
  `tipo_unidade_organizacional` varchar(100) DEFAULT NULL,
  `area_atuacao_unidade` varchar(100) DEFAULT NULL,
  `gastos_id_gasto` int NOT NULL,
  `obras_id_obra` int NOT NULL,
  `cursos-ufrn_docentes_siape` int NOT NULL,
  `cursos-ufrn_discentes_2019_matricula1` bigint NOT NULL,
  PRIMARY KEY (`id_unidade`),
  KEY `fk_unidades_gastos_id_gasto_idx` (`gastos_id_gasto`),
  KEY `obras_id_obra_idx` (`obras_id_obra`),
  KEY `cursos-ufrn_discentes_2019_matricula_idx` (`cursos-ufrn_discentes_2019_matricula1`),
  KEY `cursos-ufrn_docentes_siape_idx` (`cursos-ufrn_docentes_siape`),
  CONSTRAINT `cursos-ufrn_discentes_2019_matricula` FOREIGN KEY (`cursos-ufrn_discentes_2019_matricula1`) REFERENCES `discentes_2019` (`matricula`),
  CONSTRAINT `cursos-ufrn_docentes_siape` FOREIGN KEY (`cursos-ufrn_docentes_siape`) REFERENCES `docentes` (`siape`),
  CONSTRAINT `gastos_id_gasto` FOREIGN KEY (`gastos_id_gasto`) REFERENCES `gastos` (`id_gasto`),
  CONSTRAINT `obras_id_obra` FOREIGN KEY (`obras_id_obra`) REFERENCES `obras` (`id_obra`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3;
/*!40101 SET character_set_client = @saved_cs_client */;

